import * as React from 'react'
import { Icon, Avatar } from 'react-native-elements'
import { View, Text } from 'react-native'
import { Button } from 'react-native-elements';

import { ListItem } from 'react-native-elements'

import { createBottomTabNavigator, createStackNavigator } from 'react-navigation';
import {
  FlatList,
  ActivityIndicator,
  TouchableOpacity
} from 'react-native'

const list = [
  {
    title: 'Appointments',
    icon: 'av-timer'
  },
  {
    title: 'Trips',
    icon: 'flight-takeoff'
  },
]



const MainView = (props) => {
  // console.log('23- inside MainView ListItem=', ListItem.Content);
  console.log('props =', props); 
  const { navigation } = props;

  return (<>

  <Button
    title="All Inbox "
    type="outline"
    onPress={() => navigation.navigate('TabOneScreen')}

  />

<Button
    title="Red Priority "
    type="outline"
    onPress={() => navigation.navigate('HighPriority')}
  />

<Button
    title="High Priority "
    type="outline"
    onPress={handleHelpPressHigh} 
  />


<Button
    title="Followup "
    type="outline"
  />

<Button
    title="Call Back "
    type="outline"
  />


<View>
  {
    list.map((l, i) => (
      <ListItem key={i} bottomDivider>
        <Avatar source={{uri: l.avatar_url}} />
        <ListItem.Content>
          <ListItem.Title>{l.name}</ListItem.Title>
          <ListItem.Subtitle>{l.subtitle}</ListItem.Subtitle>
        </ListItem.Content>
      </ListItem>
    ))
  }
</View>


</>


  )
}

function handleHelpPressAll() {
  console.log('click handleHelpPress'); 

}

function handleHelpPressRed() {
  console.log('click handleHelpPress'); 
}

function handleHelpPressHigh() {
  console.log('click handleHelpPress'); 
}

export default MainView;
